#!/usr/bin/env python3

import base64
import pickle
import re
import sys


# Give the answer modulus M
M = int(1e9) + 7

# Memoize the gcd results. Load some encoded results to help our
# function along.
ENCODED_GCDS = """"""

GCD_MEMORY = pickle.loads(base64.b64decode(ENCODED_GCDS))

def gcd(m, n):
    """Compute the greatest common divisor."""
    if (m, n) in GCD_MEMORY:
        return GCD_MEMORY[(m, n)]
    elif (n, m) in GCD_MEMORY:
        return GCD_MEMORY[(n, m)]

    # Compute GCD
    while m:
        m, n = n % m, m

    # Save the result
    GCD_MEMORY[(m, n)] = n

    # Return the result
    return n


# Read lines from stdin
lines = [line.strip() for line in sys.stdin.readlines()]

# Parse input
N = int(lines[0])
A = [int(i) for i in re.split(r'\D', lines[1])]

# Go through each length of continuous subarrays and store their GCDs.
gcd_table = {1: A}
result = 0

for s in range(2, N + 1):
    # Initialize the gcds of subarrays of length s
    gcd_table[s] = [0] * (N + 1 - s)

    # Find the gcds v's for the subarrays of length s
    for i in range(N + 1 - s):
        # Find the gcd
        gcd_table[s][i] = gcd(gcd_table[s - 1][i], gcd_table[s - 1][i + 1])

        # Get the v's for this subarray
        this_v_min = gcd_table[s][i]
        this_v_max = max([idx * val for idx, val in
                                zip(range(1, s + 1), A[i:i + s])])

        # Compute the magic value and add it to the result
        magic_val = ((this_v_max - this_v_min) * s) % M
        result = (result + magic_val) % M

# Print the result
print(result)
